export const Container = styled.div`
  display: flex;
  justify-content: center;
  width: 100%;
  height: 100%;
  cursor: pointer;
  align-items: center;
  pointer: cursor;
  -ms-user-select: none;
  -moz-user-select: -moz-none;
  -webkit-user-select: none;
